script: |
  super -f text -I q5662.spq | sort > q5662.out

inputs:
  - name: q5662.spq
    data: |
      SELECT - col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( - col2 * + CAST ( NULL AS REAL ) + + - 32 + - col2 ) NOT IN ( - col2 + 37 + + col2 );
  - name: tab0

outputs:
  - name: q5662.out
    data: |
